import React, { useState } from 'react';

import { Container, RadioContainer, CheckContainer, LabelText } from './styles';

const InputRadio: React.FC = () => {
  const [isChecked, setIsChecked] = useState(false);
  return (
    <Container>
      <RadioContainer onClick={() => setIsChecked(!isChecked)}>
        {isChecked ? <CheckContainer /> : null}
      </RadioContainer>
      <LabelText>Yes</LabelText>
    </Container>
  );
};

export default InputRadio;
